import React, { Component } from "react";
import "bootstrap/dist/css/bootstrap.min.css";

export default class Header extends Component {
  render() {
    return (
        <div>
        <h1>Hola</h1>
        <button onClick={() => this.props.onIncrement(this.props.item)} className="btn btn-lg btn-outline-secondary"></button>
        </div>
    );
  }
}
